  \"social-security-administration-public-inquiry-data-types-of-public-inquiries-received\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset gives a breakdown of the incoming
  inquiries categorized by topics by quarter and for the Fiscal Year (FY). These topics
  include program and post entitlement issues as well as questions regarding earnings
  and Social Security Numbers. Additionally, this dataset shows the number of inquiries
  related to a miscellaneous topic. The data source is the Electronic Management of
  Assignments and Correspondence system (EMAC). Examples of inquiries included within
  the miscellaneous topic are service complaints, fraud/ID theft, trust funds, and
  personnel/administrative issues.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
